import React from 'react';
import logo from '../assets/img/WorldOnpencil.png';

import "./Header.css";
import us from '../assets/img/countries/2560px-Flag_of_the_United_States.svg.png'
import ind from '../assets/img/countries/1350px-Flag_of_India.svg.png'
import SearchBar from './SearchBar';
import { faShoppingBasket } from '@fortawesome/free-solid-svg-icons';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
function Header() {
    return <div className='navbar navbar-dark bg-dark'>
        {/* // header logo */}
        <div className='header_ob'>
            <a className='navbar-brand header__logo' href='#'>
                {/* <img src={logo} className='header_logo'/> */}
                World On Pencil
            </a>
        </div>
        {/* // header search */}
        <SearchBar />

        {/* // options like  */}
        <div className="header__nav ">
            <div className="header__option header_ob">
                <span className="header__optionLineOne">Returns</span>
                <span className="header__optionLineTwo">& Orders</span>
            </div>



            <div className="header__option header_ob">
                <span className="header__optionLineOne">Your</span>
                <span className="header__optionLineTwo">Prime</span>
            </div>
            {/* // sign in */}
            <div className="header__option header_ob">
                <span className="header__optionLineOne">Hello Guest</span>
                <span className="header__optionLineTwo">Sign In</span>
            </div>
            {/* // cart */}
            <div className="header__optionBasket header_ob">
                <span className='header__optionLineOne'><FontAwesomeIcon icon={faShoppingBasket} />
                </span>
                <span className="header__optionLineTwo header__basketCount">
                    0
                </span>
            </div>
        </div>
    </div>
}

export default Header;
